:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Samuel and WILLIAMS, Mary
  JWILLIAMS, Lucy Frances and WARREN, Thomas John Cory (Jack).
  JWARREN, Alwyn Keith and LAWS, Doreen Eda
  JWARREN, Nicola Frances Caroline and BUSH, Paul David Horndon
  JBUSH, Bridget Mary and MEE, Spencer Michael
  01> BUSH, Bridget Mary m on 26.02.1994 to MEE, Spencer Michael
  b 12.05.1960
  b 10.07.1957
  Bridget b. at Christchurch and m. at Iona. Spencer, s/o Frank Spencer Mee and Joan Hughes, b. at
  Queenstown. Address: 140 Peninsula Road, Kelvin Heights, Queenstown.
  Bridget is a State registered nurse and works as a practice nurse in Queenstown. Michael is a
  farmer at Deer Park Heights.
  01> MEE, Eva Nicola
  b 21.09.1995
  Eva b. at Dunedin.
  02> MEE, Tom Spencer
  b 21.05.1998
  Tom b. at Dunedin.
  02> BUSH, Virginia Barbara
  b 13.03.1962
  Virginia b. at Christchurch. Address: 16 Mount Iron Drive, Wanaka.
  Virginia graduated DipPTY (Physiotherapy) from Otago University in 1982 and DipMT (Manual Therapy)
  in 1991. She has a physiotherapy practice in Wanaka and has recently opened a practice in Twizel.
  03> BUSH, David Horndon m on 06.02.1996 to REEVES, Fiona Margaret
  b 13.07.1965
  b 14.11.1967
  David m. at Te Akau. Fiona, d/o John Livingston Reeves and Margaret Helen Michie, b. at Hamilton.
  Address: "Iona", Parnassus, Cheviot, North Canterbury.
  David graduated DipAg (Farm Management) from Lincoln University in 1987 and also has a Wool
  Certificate from Lincoln. He is the third generation of the family to farm "Iona".
  Fiona's family are from Hinerua near Ngaruawahia in the Waikato. She graduated BPhysEd and
  DipTchng in 1989 and is a physical education teacher. She has played representative netball for
  Hawkes Bay, Otago, Waikato and Canterbury.
  Refer to "The Reeves of Tolaga Bay and their Descendants" published by Evagean Publishing in 1992
  for information on Fiona's family.
  01> BUSH, Rebecca Livingston
  b 14.09.1997
  Rebecca b. at Christchurch.
  04> BUSH, Antony Cromwell
  b 20.08.1969
  Antony graduated DipPTY (Physiotherapy), DipMT (Manual Therapy) and has a Post Graduate Diploma (Ex
  Phys) from Otago University. He is a physiotherapist and is presently studying for his MBA at
  Canterbury University.
  03>' WARREN, Mary Williams m on 07.11.1935 to McBAIN, Hubert
  b 31.10.1904
  b 19.10.1894 d 20.11.1975
  Mary b. at Wellington. Hubert, slo Hugh McBain, b, at Mhow, India and d. at Langton, Blandford, Dorset.
  Address: Penlee Cottage, 13 High Row, Gainford, Nr Darlington, Co. Durham, England.
  Hubert was a regular officer in the Durham Light Infantry. He was awarded the Military Cross in 1918 and
  the OBE in 1945 and was twice mentioned in despatches. He retired with the rank of Lt Colonel and was a DL
  of County Durham.
